  // 画像ロード
  var micu = new Image();
  micu.src = getImage();
  micu.width = 150;
  micu.height = 1250;
  var d = new DCore();
  d.drawImage(micu, [0, 0], [1, 0.1], [0, 0], [1, 1]);

function Player() {
  var context = new webkitAudioContext();

  var source = context.createBufferSource();
  var gainNode = context.createGainNode();		//音量変えるノード
  var analyserNode = context.createAnalyser();
    
  gainNode.gain.value = 0.5;

  source.connect(gainNode);
  gainNode.connect(analyserNode);			//destinationが最終的な出力
  analyserNode.connect(context.destination);	//RealTimeAnalyserの出力は必要かどうか意見が求められているそう

  var request = new XMLHttpRequest();
  var url = "http://jsrun.it/static/assets/svggirl/01/svg_girl_theme.ogg";

  request.open("GET", url, true);
  request.responseType = "arraybuffer";

  request.onload = function() {
    $("#play").html("<input type='button' onclick='player.play()' value='Play'>");
  };
  request.send();
    
  this.timeDomainData = new Uint8Array(analyserNode.frequencyBinCount);
  this.source = source;
  this.context = context;
  this.analyserNode = analyserNode;
  this.request = request;
};

Player.prototype = {
  play: function() {
    var source = this.source;
    var context = this.context;
    var analyserNode = this.analyserNode;
    var request = this.request;
    var timeDomainData = this.timeDomainData;
    source.buffer = context.createBuffer(request.response, false);	//ArrayBufferからバッファを作成　第２引数をtrueにするとモノラルに
    source.noteOn(context.currentTime);   //指定した時間に再生する　もし指定した時間がcontext.currentTimeより小さい場合はすぐ再生される
    
	var draw = this.draw();
    setInterval(function(){
      analyserNode.getByteTimeDomainData(timeDomainData);
      draw(timeDomainData);
    },50);
  },
  // 描画関数（初期化後に、描画用のクロージャを返す手抜き)
  draw: function() {
    var d = new DCore();

    // 画像ロード
    var micu = new Image();
    micu.src = getImage();
    micu.width = 150;
    micu.height = 1250;

    var bpm = 128.0;

    Camera = {
      // アニメーション関数をセット
      updateAnimator: function(pa, ua) {
        this.pAnimator = pa;
        this.uAnimator = ua;
        this.gAnimator = ua;
      },
      // アニメーション適用
      move: function(t) {
        if(this.pAnimator) this.p = this.pAnimator(t);
        if(this.uAnimator) this.u = this.uAnimator(t);
        if(this.gAnimator) this.g = this.gAnimator(t);
      },
      // 適用
      act: function() {
        d
         .gazeFrom(Camera.p, Camera.g, Camera.u)
        ;
      }
    };

    // アニメーション：ベジエ
    var bezier = function(p1, p2, p3, p4) {
      return function(t) {
        var u = 1 - t;
        return p1.mul(u * u * u)
          .add(p2.mul(u * u * t * 3))
           .add(p3.mul(u * t * t * 3))
            .add(p4.mul(t * t * t));
      };
    };

    // アニメーション：リニア
    var linear = function(p1, p4) {
      return bezier(p1, p1, p4, p4);
    };

    var st = +new Date();

    var preMeasure = -1;
    var detMod = 64;
    var cameraType = 0;
    var i = 0;
    var frames = [0, 0, 0, 0, 0, 0, 0];

    // 初期化ここまで、こっから描画
    return (function(data) {

      // 何小節目かを計算
      var time = (new Date() - st) / 1000;
      if(time > 30.0) return;
      var measureDet = ~~(bpm / 60 / 4 * time * 16);
      var measureDetM16 = measureDet % 16;
      var measureDetM32 = measureDet % 32;
      var measureDetM64 = measureDet % 64;

      // 何小節めかを計算。常に正方向に繰り下がる。即席
      var measure = ~~(measureDet / 16 + 256) - 256;
	
      // 小節が変わった瞬間、アニメーション関数を更新する
      if(measure >> 2 != preMeasure >> 2) {
        // ランダムでカメラアニメーションを変更
        cameraType = measure >> 2;

        switch (cameraType) {
            case 0:
              // 平行して左から右へ
              Camera.updateAnimator(
                linear([2, 0.5, 6.5], [-2, 0.5, 5.5]),
                linear([2, 0.5, 0.0], [-2, 0.2, 0.0])
              );
              break;
            case 1:
              // 上から降りる
              Camera.updateAnimator(
                linear([0, 5.2, 10.5], [0, 1, 5.5]),
                linear([0, 5.0, 0.0], [0, 1, 0.0])
              );
              break;
            case 2:
              // 平行して右から左へ
              Camera.updateAnimator(
                linear([-2, 0.5, 6.5], [2, 0.5, 5.5]),
                linear([-2, 0.5, 0.0], [2, 0.5, 0.0])
              );
              break;
            case 3:
              // 左から右へ突き抜け
              Camera.updateAnimator(
                linear([-1, 0.5, 5.5], [1, 1, -4.5]),
                linear([1, 0.5, 0.0], [3, 1, 0.0])
              );
              break;
        }
      }
      // アニメーションタイムラインを設定
      Camera.move(measureDetM64 / 64);
      // 前回小節の保存
      preMeasure = measure;

      // カメラ位置設定
      Camera.u = [0, 1, 0];
      Camera.act();
	
      // 初期化
      d.rgb(0xff, 0xff, 0xff).fillBack();

      // 床描く
      $R(-8, 8, false).map(function(x) {
        $R(-6, 6, false).map(function(z) {
          d
           .alpha(1.0)
           .rgb([[0xdd, 0xff, 0xee], [0x99, 0xee, 0xaa]][(x + z) & 1])
           .quads([
             [ 0.25, 0, 0.25],
             [-0.25, 0, 0.25],
             [-0.25, 0,-0.25],
             [ 0.25, 0,-0.25]
           ].translate([x * 0.5, 0, z * 0.5])
           ).fill();
          });
      });


      // 
      var toTempl = Geo.rect().map(function(a) {
          return [a[0] - 0.5, -a[1] + 1, 0.0];
      });
	
      // 描画タスクを作成(優先度＋描画関数)
      drawingTask = $R(-3, 3, false).map(function(x) {
	var k = x + 3;
	var p = (data[128 + k * 128] - 128).abs() * 0.05;
	if(p > 0.1) frames[k] += p;
  
        // 画像転送用マトリックス設定
        var from = 
          Geo.rect()
          .scale([1.0, 0.1])
          .translate([0.0, 0.1 * ~~(frames[k] % 10)])
        ;
        return $R(-2, 2, false).map(function(z) {
          var to = toTempl.translate(
            [x, 0, z]
          )
          var dist = to.invoke("distance", Camera.p).sort().last();
          return [dist, function(to, dist) {
            d.transformTo(from, to, function(d) {
              d
               .blend("source-over")
               .alpha(1 - dist * 0.04)
               .drawImage(micu)
              ;
            });
          }.curry(to, dist)];
        });
      }).shallowFlatten();

      // タスクキューから優先度付きで実行
      drawingTask.sortBy(function(e){
        return -e[0];
      }).each(function(e) {
        e[1] && e[1]();
      });

      i++;
    });
  }
};
var player = new Player();


